    [],nt"revision_timestamp": "2016-05-31T03:05:18.077277",nt"name": "joint-typhoon-warning-center-storm-wallets",nt"isopen":
    false,nt"url": null,nt"notes": "The Joint Typhoon Warning Center (JTWC)
    is responsible for typhoon forecasts and warnings for the Western Pacific and Indian
    Ocean basins. After each storm, the JTWC stores its records in accordion-style folders,
    or "wallets". Facing prohibitive storage costs and space constraints for historical
    wallets, the JTWC contacted CDMP to inquire about storage of this one-of-a-kind
    data. There are 1,523 wallets in the collection, spanning four cyclone basins in
    the period 1966-1994. NCDC received these wallets in August of 2009, and ingested
    them into their physical archives. Around 70 wallets were scanned and are available
    for download.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
